const aggregateEvents = (events) => {
    console.log(events);
    const eventMap = {}
    events.forEach(event => {
        const eventName = event.summary;
        const startTime = new Date(removeTimeZone(event.start));
        const endTime = new Date(removeTimeZone(event.end));

        console.log(startTime, endTime);

        const time = endTime - startTime;

        if (time in eventMap) { 
            eventMap[eventName] += time;
        } else {
            eventMap[eventName] = time;
        }
    });

    return eventMap;
}

const removeTimeZone = (datetime) => {
    datetime = datetime.substring(0, datetime.length - 5);
    return datetime;
}

export default aggregateEvents;
